export const INITIAL_STATE = {
  counter: 0,
  show: true,
};

export const COUNTER_ACTIONS = {
  CUSTOM_INCREMENT: "customIncrement",
  INCREMENT: "increment",
  DECREMENT: "decrement",
  TOGGLE_SHOW: "toggleShow",
};
